#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>

typedef struct {
    int *row_ptr;  // 存储每行的起始位置
    int *col_idx;  // 存储每行的邻居节点
    int *data;     // 存储每条边的权重
    int num_vertices;  // 顶点数量
} CSRGraph;

// 创建CSR图
CSRGraph* create_graph(int num_vertices, int *row_ptr, int *col_idx, int *edge_weights) {
    CSRGraph *graph = (CSRGraph*) malloc(sizeof(CSRGraph));
    graph->num_vertices = num_vertices;
    graph->row_ptr = row_ptr;
    graph->col_idx = col_idx;
    graph->data = edge_weights;  // 存储每条边的权重
    return graph;
}

int a = 0;

// BFS算法，不使用队列
__attribute__ ((__used__)) static void bfs(CSRGraph *graph, int start_vertex) {
    bool *visited = (bool*) malloc(graph->num_vertices * sizeof(bool));
    for (int i = 0; i < graph->num_vertices; i++) {
        visited[i] = false;  // 初始化所有节点为未访问
    }

    visited[start_vertex] = true;
   // printf("BFS Traversal starting from vertex %d:\n", start_vertex);

    // 使用数组模拟队列
    int *queue = (int*) malloc(graph->num_vertices * sizeof(int));
    int front = 0, rear = 0;

    // 将起始节点放入队列
    queue[rear++] = start_vertex;

    // 遍历队列
    while (front < rear) {
        int vertex = queue[front++];
//        printf("Node %d (Data: %d) ", vertex, vertex);  // 打印节点的索引和数据（假设节点数据即为其编号）

        // 遍历当前节点的邻居
        for (int i = graph->row_ptr[vertex]; i < graph->row_ptr[vertex + 1]; i++) {
            int neighbor = graph->col_idx[i];
            int edge_weight = graph->data[i];  // 获取边的权重
            if (!visited[neighbor]) {
                visited[neighbor] = true;
                queue[rear++] = neighbor;  // 将未访问的邻居加入队列
                a++;
            }
//             printf("-> Neighbor %d (Edge weight: %d) ", neighbor, edge_weight);  // 打印邻居节点和边权重
        }
 //        printf("\n");
    }

    free(visited);
    free(queue);
}

